import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import { Link } from "react-router-dom";

function VanNavBar() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary p-3 shadow">
      <div className="d-flex align-items-center justify-content-between">
        <Link
          to="/"
          className="nav_brand text-decoration-none fw-bold text-primary h3 mb-0"
        >
          # Van Life
        </Link>

        <div className="dflex align-items-center justify-content-between bg-success">
          <Link
            to="/"
            className="nav_brand text-decoration-none fw-bold text-primary h3 mb-0"
          >
            about
          </Link>
          <Link
            to="/"
            className="nav_brand text-decoration-none fw-bold text-primary h3 mb-0"
          >
            about
          </Link>
        </div>
      </div>
    </Navbar>
  );
}

export default VanNavBar;
